INSERT INTO `movies` VALUES (1,'Inception','2010-07-15','Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person\'s idea into a target\'s subconscious.','https://image.tmdb.org/t/p/w440_and_h660_face//oYuLEt3zVCKq57qu2F8dT7NIa6f.jpg'),(2,'The Godfather','1972-03-14','Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.','https://image.tmdb.org/t/p/w440_and_h660_face//3bhkrj58Vtu7enYsRolD1fZdja1.jpg'),(3,'The Godfather Part III','1990-12-25','In the midst of trying to legitimize his business dealings in 1979 New York and Italy, aging mafia don, Michael Corleone seeks forgiveness for his sins while taking a young protege under his wing.','https://image.tmdb.org/t/p/w440_and_h660_face//lm3pQ2QoQ16pextRsmnUbG2onES.jpg'),(4,'The Godfather Part II','1974-12-20','In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.','https://image.tmdb.org/t/p/w440_and_h660_face//hek3koDUyRQk7FIhPXsa6mT2Zc3.jpg'),(5,'The Shawshank Redemption','1994-09-23','Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.','https://image.tmdb.org/t/p/w440_and_h660_face//q6y0Go1tsGEsmtFryDOJo3dEmqu.jpg'),(6,'Schindler\'s List','1993-12-15','The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.','https://image.tmdb.org/t/p/w440_and_h660_face//sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg'),(7,'Spirited Away','2001-07-20','A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.','https://image.tmdb.org/t/p/w440_and_h660_face//39wmItIWsg5sZMyRUHLkWBcuVCM.jpg'),(8,'Parasite','2019-05-30','All unemployed, Ki-taek\'s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.','https://image.tmdb.org/t/p/w440_and_h660_face//7IiTTgloJzvGI1TAYymCfbfl3vT.jpg'),(9,'The Dark Knight','2008-07-16','Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.','https://image.tmdb.org/t/p/w440_and_h660_face//qJ2tW6WMUDux911r6m7haRef0WH.jpg'),(10,'The Dark Knight Rises','2012-07-17','Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dent\'s crimes to protect the late attorney\'s reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gotham\'s finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.','https://image.tmdb.org/t/p/w440_and_h660_face//hr0L2aueqlP2BYUblTTjmtn0hw4.jpg'),(11,'The Dark Kingdom','2018-11-26','To save their Kingdom from an army of undead, a group of warriors must travel through the forbidden lands fighting the fearsome beasts that call The Dark Kingdom their home.','https://image.tmdb.org/t/p/w440_and_h660_face//o7StI2iR8yY1N67meSkNcXfojyD.jpg'),(12,'Batman: The Dark Knight Returns, Part 2','2013-01-03','Batman has stopped the reign of terror that The Mutants had cast upon his city.  Now an old foe wants a reunion and the government wants The Man of Steel to put a stop to Batman.','https://image.tmdb.org/t/p/w440_and_h660_face//arEZYd6uMOFTILne9Ux0A8qctMe.jpg'),(13,'Your Name.','2016-08-26','High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.','https://image.tmdb.org/t/p/w440_and_h660_face//q719jXXEzOoYaps6babgKnONONX.jpg'),(14,'Pulp Fiction','1994-09-10','A burger-loving hit man, his philosophical partner, a drug-addled gangster\'s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.','https://image.tmdb.org/t/p/w440_and_h660_face//d5iIlFn5s0ImszYzBPb8JPIfbXD.jpg'),(16,'The Truman Show','1998-06-04','Truman Burbank is the star of The Truman Show, a 24-hour-a-day reality TV show that broadcasts every aspect of his life without his knowledge. His entire life has been an unending soap opera for consumption by the rest of the world. And everyone he knows, including his wife and his best friend, is really an actor, paid to be part of his life.','https://image.tmdb.org/t/p/w440_and_h660_face//vuza0WqY239yBXOadKlGwJsZJFE.jpg'),(17,'Avengers: Infinity War','2018-04-25','As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.','https://image.tmdb.org/t/p/w440_and_h660_face//7WsyChQLEftFiDOVTGkv3hFpyyt.jpg'),(18,'Avengers: Endgame','2019-04-24','After the devastating events of Avengers: Infinity War, the universe is in ruins due to the efforts of the Mad Titan, Thanos. With the help of remaining allies, the Avengers must assemble once more in order to undo Thanos\' actions and restore order to the universe once and for all, no matter what consequences may be in store.','https://image.tmdb.org/t/p/w440_and_h660_face//or06FN3Dka5tukK1e9sl16pB3iy.jpg'),(19,'The Avengers','2012-04-25','When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!','https://image.tmdb.org/t/p/w440_and_h660_face//RYMX2wcKCBAr24UyPD7xwmjaTn.jpg'),(20,'Avengers: Age of Ultron','2015-04-22','When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.','https://image.tmdb.org/t/p/w440_and_h660_face//4ssDuvEDkSArWEdyBl2X5EHvYKU.jpg'),(21,'Thor','2011-04-21','Against his father Odin\'s will, The Mighty Thor - a powerful but arrogant warrior god - recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.','https://image.tmdb.org/t/p/w440_and_h660_face//prSfAi1xGrhLQNxVSUFh61xQ4Qy.jpg'),(22,'Thor: Love and Thunder','2022-07-06','After his retirement is interrupted by Gorr the God Butcher, a galactic killer who seeks the extinction of the gods, Thor Odinson enlists the help of King Valkyrie, Korg, and ex-girlfriend Jane Foster, who now wields Mjolnir as the Mighty Thor. Together they embark upon a harrowing cosmic adventure to uncover the mystery of the God Butcher’s vengeance and stop him before it’s too late.','https://image.tmdb.org/t/p/w440_and_h660_face//pIkRyD18kl4FhoCNQuWxWu5cBLM.jpg'),(23,'Thor: Ragnarok','2017-10-02','Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his home-world and the end of Asgardian civilization, at the hands of a powerful new threat, the ruthless Hela.','https://image.tmdb.org/t/p/w440_and_h660_face//rzRwTcFvttcN1ZpX2xv4j3tSdJu.jpg'),(24,'Coco','2017-10-27','Despite his family’s baffling generations-old ban on music, Miguel dreams of becoming an accomplished musician like his idol, Ernesto de la Cruz. Desperate to prove his talent, Miguel finds himself in the stunning and colorful Land of the Dead following a mysterious chain of events. Along the way, he meets charming trickster Hector, and together, they set off on an extraordinary journey to unlock the real story behind Miguel\'s family history.','https://image.tmdb.org/t/p/w440_and_h660_face//gGEsBPAijhVUFoiNpgZXqRVWJt2.jpg'),(26,'The Lord of the Rings: The Fellowship of the Ring','2001-12-18','Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.','https://image.tmdb.org/t/p/w440_and_h660_face//6oom5QYQ2yQTMJIbnvbkBL9cHo6.jpg'),(27,'The Lord of the Rings: The Return of the King','2003-12-01','Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Sauron\'s forces. Meanwhile, Frodo and Sam take the ring closer to the heart of Mordor, the dark lord\'s realm.','https://image.tmdb.org/t/p/w440_and_h660_face//rCzpDGLbOoPwLjy3OAm5NUPOTrC.jpg'),(28,'The Lord of the Rings: The Two Towers','2002-12-18','Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.','https://image.tmdb.org/t/p/w440_and_h660_face//5VTN0pR8gcqV3EPUHHfMGnJYN9L.jpg'),(29,'The Lord of the Rings: The Rings of Power Global Fan Screening','2022-08-31','An edited version of the first two episodes of The Lord of the Rings: The Rings of Power, shown exclusively to fans in cinemas around the world in August 2022. In a time of relative peace, an ensemble cast of characters confronts the re-emergence of evil to Middle-earth.','https://image.tmdb.org/t/p/w440_and_h660_face//toEUQXyDut4QecjC3RAdBoDVlUe.jpg'),(30,'Harry Potter and the Philosopher\'s Stone','2001-11-16','Harry Potter has lived under the stairs at his aunt and uncle\'s house his whole life. But on his 11th birthday, he learns he\'s a powerful wizard—with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the school\'s kindly headmaster, Harry uncovers the truth about his parents\' deaths—and about the villain who\'s to blame.','https://image.tmdb.org/t/p/w440_and_h660_face//wuMc08IPKEatf9rnMNXvIDxqP4W.jpg'),(31,'Harry Potter and the Chamber of Secrets','2002-11-13','Cars fly, trees fight back, and a mysterious house-elf comes to warn Harry Potter at the start of his second year at Hogwarts. Adventure and danger await when bloody writing on a wall announces: The Chamber Of Secrets Has Been Opened. To save Hogwarts will require all of Harry, Ron and Hermione’s magical abilities and courage.','https://image.tmdb.org/t/p/w440_and_h660_face//sdEOH0992YZ0QSxgXNIGLq1ToUi.jpg'),(32,'Harry Potter and the Goblet of Fire','2005-11-16','When Harry Potter\'s name emerges from the Goblet of Fire, he becomes a competitor in a grueling battle for glory among three wizarding schools—the Triwizard Tournament. But since Harry never submitted his name for the Tournament, who did? Now Harry must confront a deadly dragon, fierce water demons and an enchanted maze only to find himself in the cruel grasp of He Who Must Not Be Named.','https://image.tmdb.org/t/p/w440_and_h660_face//fECBtHlr0RB3foNHDiCBXeg9Bv9.jpg'),(33,'Harry Potter and the Half-Blood Prince','2009-07-15','As Lord Voldemort tightens his grip on both the Muggle and wizarding worlds, Hogwarts is no longer a safe haven. Harry suspects perils may even lie within the castle, but Dumbledore is more intent upon preparing him for the final battle fast approaching. Together they work to find the key to unlock Voldemorts defenses and to this end, Dumbledore recruits his old friend and colleague Horace Slughorn, whom he believes holds crucial information. Even as the decisive showdown looms, romance blossoms for Harry, Ron, Hermione and their classmates. Love is in the air, but danger lies ahead and Hogwarts may never be the same again.','https://image.tmdb.org/t/p/w440_and_h660_face//z7uo9zmQdQwU5ZJHFpv2Upl30i1.jpg'),(34,'Harry Potter and the Prisoner of Azkaban','2004-05-31','Year three at Hogwarts means new fun and challenges as Harry learns the delicate art of approaching a Hippogriff, transforming shape-shifting Boggarts into hilarity and even turning back time. But the term also brings danger: soul-sucking Dementors hover over the school, an ally of the accursed He-Who-Cannot-Be-Named lurks within the castle walls, and fearsome wizard Sirius Black escapes Azkaban. And Harry will confront them all.','https://image.tmdb.org/t/p/w440_and_h660_face//aWxwnYoe8p2d2fcxOqtvAtJ72Rw.jpg'),(35,'Harry Potter and the Deathly Hallows: Part 1','2010-11-17','Harry, Ron and Hermione walk away from their last year at Hogwarts to find and destroy the remaining Horcruxes, putting an end to Voldemort\'s bid for immortality. But with Harry\'s beloved Dumbledore dead and Voldemort\'s unscrupulous Death Eaters on the loose, the world is more dangerous than ever.','https://image.tmdb.org/t/p/w440_and_h660_face//iGoXIpQb7Pot00EEdwpwPajheZ5.jpg'),(36,'Harry Potter and the Deathly Hallows: Part 2','2011-07-12','Harry, Ron and Hermione continue their quest to vanquish the evil Voldemort once and for all. Just as things begin to look hopeless for the young wizards, Harry discovers a trio of magical objects that endow him with powers to rival Voldemort\'s formidable skills.','https://image.tmdb.org/t/p/w440_and_h660_face//c54HpQmuwXjHq2C9wmoACjxoom3.jpg'),(37,'Harry Potter and the Order of the Phoenix','2007-07-08','Returning for his fifth year of study at Hogwarts, Harry is stunned to find that his warnings about the return of Lord Voldemort have been ignored. Left with no choice, Harry takes matters into his own hands, training a small group of students to defend themselves against the dark arts.','https://image.tmdb.org/t/p/w440_and_h660_face//5aOyriWkPec0zUDxmHFP9qMmBaj.jpg'),(38,'Shutter Island','2010-02-14','World War II soldier-turned-U.S. Marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by troubling visions and a mysterious doctor.','https://image.tmdb.org/t/p/w440_and_h660_face//4GDy0PHYX3VRXUtwK5ysFbg3kEx.jpg'),(39,'Django Unchained','2012-12-25','With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.','https://image.tmdb.org/t/p/w440_and_h660_face//7oWY8VDWW7thTzWh3OKYRkWUlD5.jpg'),(40,'Pinocchio','1940-02-23','When loving Geppetto creates a wooden puppet, his wish is granted when it comes to life as a little wooden boy named Pinocchio. With his faithful friend and conscience Jiminy Cricket by his side, Pinocchio, embarks on fantastic adventures that his bravery, loyalty and honesty until triumphs in his triumphs in his quest for his heart\'s desire: to become a real boy.','https://image.tmdb.org/t/p/w440_and_h660_face//bnZJrLRnoQHpzEJdka1KYfsAF3N.jpg'),(41,'Pinocchio','2022-09-07','A wooden puppet embarks on a thrilling adventure to become a real boy.','https://image.tmdb.org/t/p/w440_and_h660_face//g8sclIV4gj1TZqUpnL82hKOTK3B.jpg'),(42,'Pinocchio','2019-12-19','In this live-action adaptation of the beloved fairytale, old woodcarver Geppetto fashions a wooden puppet, Pinocchio, who magically comes to life. Pinocchio longs for adventure and is easily led astray, encountering magical beasts, fantastical spectacles, while making friends and foes along his journey. However, his dream is to become a real boy, which can only come true if he finally changes his ways.','https://image.tmdb.org/t/p/w440_and_h660_face//y5qFpo1eEdsHCPh2zZyplzxaxsU.jpg'),(44,'Good Will Hunting','1997-12-05','Will Hunting has a genius-level IQ but chooses to work as a janitor at MIT. When he solves a difficult graduate-level math problem, his talents are discovered by Professor Gerald Lambeau, who decides to help the misguided youth reach his potential. When Will is arrested for attacking a police officer, Professor Lambeau makes a deal to get leniency for him if he will get treatment from therapist Sean Maguire.','https://image.tmdb.org/t/p/w440_and_h660_face//bABCBKYBK7A5G1x0FzoeoNfuj2.jpg'),(45,'Soul','2020-12-25','Joe Gardner is a middle school teacher with a love for jazz music. After a successful audition at the Half Note Club, he suddenly gets into an accident that separates his soul from his body and is transported to the You Seminar, a center in which souls develop and gain passions before being transported to a newborn child. Joe must enlist help from the other souls-in-training, like 22, a soul who has spent eons in the You Seminar, in order to get back to Earth.','https://image.tmdb.org/t/p/w440_and_h660_face//hm58Jw4Lw8OIeECIq5qyPYhAeRJ.jpg'),(46,'Moana','2025-06-26','In Ancient Polynesia, when a terrible curse incurred by Maui reaches the island of an impetuous Chieftain, his willful daughter answers the Ocean\'s call to seek out the demigod to set things right.','https://image.tmdb.org/t/p/w440_and_h660_face//ys0jZr0quHERDUEoCboGQEKPvgQ.jpg'),(47,'Frozen','2013-11-20','Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. She\'s accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.','https://image.tmdb.org/t/p/w440_and_h660_face//kgwjIb2JDHRhNk13lmSxiClFjVk.jpg'),(48,'Saving Private Ryan','1998-07-24','As U.S. troops storm the beaches of Normandy, three brothers lie dead on the battlefield, with a fourth trapped behind enemy lines. Ranger captain John Miller and seven men are tasked with penetrating German-held territory and bringing the boy home.','https://image.tmdb.org/t/p/w440_and_h660_face//uqx37cS8cpHg8U35f9U5IBlrCV3.jpg'),(49,'Gladiator','2000-05-04','In the year 180, the death of emperor Marcus Aurelius throws the Roman Empire into chaos.  Maximus is one of the Roman army\'s most capable and trusted generals and a key advisor to the emperor.  As Marcus\' devious son Commodus ascends to the throne, Maximus is set to be executed.  He escapes, but is captured by slave traders.  Renamed Spaniard and forced to become a gladiator, Maximus must battle to the death with other men for the amusement of paying audiences.','https://image.tmdb.org/t/p/w440_and_h660_face//ty8TGRuvJLPUmAR1H1nRIsgwvim.jpg'),(50,'Jujutsu Kaisen 0','2021-12-24','Yuta Okkotsu is a nervous high school student who is suffering from a serious problem—his childhood friend Rika has turned into a curse and won\'t leave him alone. Since Rika is no ordinary curse, his plight is noticed by Satoru Gojo, a teacher at Jujutsu High, a school where fledgling exorcists learn how to combat curses. Gojo convinces Yuta to enroll, but can he learn enough in time to confront the curse that haunts him?','https://image.tmdb.org/t/p/w440_and_h660_face//23oJaeBh0FDk2mQ2P240PU9Xxfh.jpg'),(51,'Jujutsu Kaisen: The Stage','2023-01-18','The stageplay adaptation of the popular manga by Gege Akutami, Jujutsu Kaisen.','https://image.tmdb.org/t/p/w440_and_h660_face//pERBi1D8NNpK1q7dEnXDhrLz3le.jpg'),(54,'testing again','2023-12-06','','https://www.momswhothink.com/wp-content/uploads/2023/02/iStock-1397267365.jpg'),(56,'testing','2023-12-04','','f');
