CREATE DEFINER=`root`@`localhost` PROCEDURE `get_admin_reports_with_movieId_and_review`(aid VARCHAR(64))
BEGIN
SELECT reports.*, movie_id, reviews.* FROM reports 
	JOIN reviews 
		USING (rev_id)
